import { Component, OnInit } from '@angular/core';
import { EventsService } from 'src/app/services/events.service';

@Component({
  selector: 'app-event-read',
  templateUrl: './event-read.component.html',
  styleUrls: ['./event-read.component.css']
})
export class EventReadComponent implements OnInit {

  constructor(
    private readService: EventsService
    ){}

    ngOnInit(): void{
      this.getevent();
    }

    getevent(){
      this.readService.getevent().subscribe({
        next:(res) => { 
            console.log(res)
        }, 
        error: (err) => {
          console.log(err)
        }

      })
    }

  }

}
